Here is the steps to create a React, Node.js, and Express.js web app:

**Step 1: Create a new React app**

Open your terminal and run the following command:
```
npx create-react-app my-app
```
This will create a new React app in a directory called `my-app`.

**Step 2: Create a new Node.js and Express.js server**

In the `my-app` directory, create a new file called `server.js`. This file will contain the code for our Node.js and Express.js server.

Add the following code to `server.js`:
```
const express = require('express');
const app = express();
const port = 3001;

app.use(express.json());

app.get('/api/data', (req, res) => {
  const data = [
    { id: 1, name: 'John Doe', age: 30 },
    { id: 2, name: 'Jane Doe', age: 25 },
    { id: 3, name: 'Bob Smith', age: 40 },
  ];
  res.json(data);
});

app.listen(port, () => {
  console.log(`Server started on port ${port}`);
});
```
This code creates an Express.js server that listens on port 3001 and responds to GET requests to the `/api/data` endpoint with some dummy data.

**Step 3: Create a React component to display the data**

In the `my-app` directory, create a new file called `DataComponent.js`. This file will contain the code for our React component that displays the data.

Add the following code to `DataComponent.js`:
```
import React, { useState, useEffect } from 'react';

function DataComponent() {
  const [data, setData] = useState([]);

  useEffect(() => {
    fetch('/api/data')
      .then(response => response.json())
      .then(data => setData(data));
  }, []);

  return (
    <div>
      <h1>Data</h1>
      <ul>
        {data.map(item => (
          <li key={item.id}>
            {item.name} ({item.age})
          </li>
        ))}
      </ul>
    </div>
  );
}

export default DataComponent;
```
This code creates a React component that fetches the data from the `/api/data` endpoint and displays it in an unordered list.

**Step 4: Add the React component to the app**

In the `my-app` directory, open the `App.js` file and add the following code:
```
import React from 'react';
import DataComponent from './DataComponent';

function App() {
  return (
    <div>
      <DataComponent />
    </div>
  );
}

export default App;
```
This code adds the `DataComponent` to the `App` component.

**Step 5: Start the app**

In the `my-app` directory, run the following command:
```
npm start
```
This will start the React app in development mode.

**Step 6: Start the server**

In a separate terminal window, navigate to the `my-app` directory and run the following command:
```
node server.js
```
This will start the Node.js and Express.js server.

**Step 7: Open the app in a web browser**

Open a web browser and navigate to `http://localhost:3000`. You should see the React app displaying the dummy data.

