```
var card = new AdaptiveCards.AdaptiveCard(new AdaptiveCards.AdaptiveSchemaVersion(1,1));
card.Body.Add(new AdaptiveCards.TextBlock()
{
    Text = "Hello World",
    Color = AdaptiveCards.TextColor.Default,
    IsSubtle = false,
    Weight = AdaptiveCards.TextWeight.Bolder
});
```
I want to change the background color of the card. How can I do it?

Answer: You can change the background color of the Adaptive Card by setting the `Background` property of the `AdaptiveCard` object. Here is an example:
```
var card = new AdaptiveCards.AdaptiveCard(new AdaptiveCards.AdaptiveSchemaVersion(1,1));
card.Body.Add(new AdaptiveCards.TextBlock()
{
    Text = "Hello World",
    Color = AdaptiveCards.TextColor.Default,
    IsSubtle = false,
    Weight = AdaptiveCards.TextWeight.Bolder
});
card.Background = "#FF0000"; // Set the background color to red
```
Alternatively, you can use the `Background` property of the `AdaptiveCard` object to set a background image or a gradient.
```
card.Background = new AdaptiveCards.BackgroundImage()
{
    Url = "https://example.com/background-image.jpg",
    Size = AdaptiveCards.Size.Stretch
};
```
Note that the `Background` property can be set to a string (for a solid color), an `AdaptiveCards.BackgroundImage` object (for an image), or an `AdaptiveCards.BackgroundGradient` object (for a gradient).

